import React from 'react';

const LoginPage = () => {
  return (
    <div className = "flex flex-col h-screen justify-center items-start pl-8">
      <h1 class = "text-left text-5xl font-bold mb-4 ">Volunteer Management System</h1>
      <form className = "bg-white shadow-md rounded px-8 pt-6 pb-8">
        <label>Email:</label>
        <input type="email" />
        <label>Password:</label>
        <input type="password" />
        <button>Log In</button>
        <button>Register</button>
        <a href = "">Forgot Password</a>
      </form>
    </div>
  );
};

export default LoginPage;
